INSERT INTO `boye_evaluation` (`id`, `type`, `title`, `desc`, `user_id`, `create_time`, `update_time`, `status`, `roles`) VALUES
(1, 'mbti', 'MBTI职业性格测试', '&lt;p&gt;1、参加测试的人员请务必诚实、独立地回答问题，只有如此，才能得到有效的结果。&amp;nbsp;&lt;/p&gt;&lt;p&gt;2、《性格分析报告》展示的是你的性格倾向，而不是你的知识、技能、经验。&amp;nbsp;&lt;/p&gt;&lt;p&gt;3、MBTI提供的性格类型描述仅供测试者确定自己的性格类型之用，性格类型没有好坏，只有不同。每一种性格特征都有其价值和优点，也有缺点和需要注意的地方。清楚地了解自己的性格优劣势，有利于更好地发挥自己的特长，而尽可能的在为人处事中避免自己性格中的劣势，更好地和他人相处，更好地作重要的决策。&amp;nbsp;&lt;/p&gt;&lt;p&gt;4、本测试分为四部分，共93题；需时约18分钟。所有题目没有对错之分，请根据自己的实际情况选择。&lt;/p&gt;&lt;p&gt;只要你是认真、真实地填写了测试问卷，那么通常情况下你都能得到一个确实和你的性格相匹配的类型。希望你能从中或多或少地获得一些有益的信息。&lt;/p&gt;', 34, 1431416232, 1431416232, 1, '6,8,'),
(2, 'scl90', '症状自评(SCL-90)量表', '指导语：以下列出了有些人可能会有的问题，请仔细地阅读每一条，然后根据最近一星期以内下述情况影响您的实际感觉。\r\n', 34, 1431587900, 1431587900, 1, '6,7,8,');
