(1, 2, 'a:2:{s:7:"f_score";a:11:{i:0;a:3:{s:8:"allscore";i:377;s:14:"positive_items";i:90;s:3:"avg";s:4:"4.19";}i:1;a:2:{s:5:"total";i:48;s:3:"avg";s:4:"4.00";}i:2;a:2:{s:5:"total";i:43;s:3:"avg";s:4:"4.30";}i:3;a:2:{s:5:"total";i:36;s:3:"avg";s:4:"4.00";}i:4;a:2:{s:5:"total";i:55;s:3:"avg";s:4:"4.23";}i:5;a:2:{s:5:"total";i:44;s:3:"avg";s:4:"4.40";}i:6;a:2:{s:5:"total";i:27;s:3:"avg";s:4:"4.50";}i:7;a:2:{s:5:"total";i:28;s:3:"avg";s:4:"4.00";}i:8;a:2:{s:5:"total";i:24;s:3:"avg";s:4:"4.00";}i:9;a:2:{s:5:"total";i:43;s:3:"avg";s:4:"4.30";}i:10;a:2:{s:5:"total";i:29;s:3:"avg";s:4:"4.14";}}s:4:"desc";a:3:{s:4:"desc";a:3:{i:0;s:105:"该测验结果总分 377，大于160；提示有阳性意义. 受检者自我感觉不在良好状态。";i:1;s:116:"该测验结果阳性项目数：90，大于43； 提示有阳性意义. 受检者自我感觉不在良好状态。";i:2;s:121:"该测验结果阳性症状均分为 4.19，大于2； 提示有阳性意义. 受检者自我感觉不在良好状态。";}s:8:"descF110";a:20:{i:0;s:70:"躯体化：因子分 4.00 分，超过2分，提示有阳性意义。";i:1;s:189:"躯体化因子主要反映被试者的主观的身体不适感，包括心血管、胃肠道、呼吸等系统的不适，及头痛、背痛、肌肉酸痛及焦虑等其他躯体表现。";i:2;s:74:"强迫症状：因子分 4.30 分，超过2分，提示有阳性意义。 ";i:3;s:239:"强迫症状因子主要指那种明知没有必要，但又无法摆脱的无意义的思想、冲动、行为等表现，还有一些比较一般的感知障碍(如脑子变空了，“记忆力不行”等)也在这一因子中反映。";i:4;s:80:"人际关系敏感：因子分 4.00 分，超过2分，提示有阳性意义。 ";i:5;s:234:"人际关系敏感：该因子主要是反映某些个人不自在感与自卑感，尤其是在与其他人相比较时更为突出。自卑感、懊丧、以及在人事关系明显相处不好的人，往往这一因子得高分。";i:6;s:68:"忧郁：因子分 4.23 分，超过2分，提示有阳性意义。 ";i:7;s:309:"忧郁因子：反映的是临床上忧郁症状群相联系的广泛的概念。忧郁苦闷的感情和心境是代表性症状，它还以对生活的兴趣减退，缺乏活动的愿望、丧失活动力等为特征，并包括失望、悲叹、与忧郁相联系的其它感知及躯体方面的问题。";i:8;s:68:"焦虑：因子分 4.40 分，超过2分，提示有阳性意义。 ";i:9;s:316:"焦虑因子：包括一些通常临床上明显与焦虑症状相联系的症状与体验。一般指那些无法静息、神经过敏、紧张、以及由此产生躯体征象 (如震颤) 。那种游离不定的焦虑及惊恐发作是本因子的主要内容，它还包括有一个反映“解体”的项目。";i:10;s:68:"敌对：因子分 4.50 分，超过2分，提示有阳性意义。 ";i:11;s:189:"敌对因子：主要以三方面来反映病人的敌对表现、思想、感情及行为。包括从厌烦、争论、摔物、直至争斗和不可抑制的冲动暴发等各个方面。";i:12;s:68:"恐怖：因子分 4.00 分，超过2分，提示有阳性意义。 ";i:13;s:207:"恐怖因子：与传统的恐怖状态所反映的内容基本一致，恐惧的对象包括出门旅行，空旷场地、人群、或公共场合及交通工具。此外还有反映社交恐怖的项目。";i:14;s:68:"偏执：因子分 4.00 分，超过2分，提示有阳性意义。 ";i:15;s:224:"偏执因子：偏执是一个十分复杂的概念，本因子只是包括了它的一些基本内容，主要是指思维方面，  如投射性思维，敌对、猜疑、关系妄想、忘想、被动体验和夸大等。";i:16;s:74:"精神病性：因子分 4.30 分，超过2分，提示有阳性意义。 ";i:17;s:126:"精神病性因子：其中有幻想、思维播散、被控制感、思维被插入等反映精神分裂症择定状项目。";i:18;s:68:"其它：因子分 4.14 分，超过2分，提示有阳性意义。 ";i:19;s:48:"其它因子是反映睡眠及饮食情况的。";}s:7:"summary";a:1:{i:0;s:199:"其中 敌对 因子分最高,躯体化,强迫症状,人际关系敏感,忧郁,焦虑,敌对,恐怖,偏执,精神病性,其它,均不在理想的状态，根据以上分析，建议进一步检查。";}}}', 'scl90', 36, 3, 1, '', 1432274074, '6,', 1432359988),
